import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Header';
import IrisPredictForm from './IrisPredictForm';
import ResultPredictForm from './ResultPredictForm';

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/iris-model" element={<IrisPredictForm modelType="iris_model" />} />
        <Route path="/result-model" element={<ResultPredictForm modelType="result_model" />} />
      </Routes>
    </Router>
  );
};

// HomePage bileşeni tanımlanmalı
const HomePage = () => {
  return <div>Welcome to the Home Page!</div>;
};

export default App;
